function getModules(actionType)
{
	//This function creates the dropdown that keeps the modules name based on actionType
	//actionType <string> : Name of the action type, ex: "get", "create", "search","delete"

	//Modules based on actionType(get,create,update,add)
	var modules = {
		"get":["accounts","contacts","products","tickets","contracts","tasks"],
		"create":["accounts","contacts","products","tickets","contracts","tasks"],
		"update":["accounts","contacts","products","tickets","contracts","tasks"],
		"delete":["accounts","contacts","products","tickets","contracts"],
		"list":["accounts","contacts","products","tickets","contracts","tasks"],
		"search":["accounts","contacts","products","tickets","tasks"],
		"addComment":["accounts","contacts","products","tickets","contracts","tasks"],
		"editSpam": ["contacts","tickets"]
	}

	if(iml.isMissing(modules[actionType]))
		return null;

	var sortModules = iml.sort(modules[actionType],"asc");

	//Values for actionType = ["get","create","list","search","delete","update"]
	var modulesRPC = {
		"create":"rpc://getOrganizationFields","update":"rpc://getOrganizationFields",
		"search":"rpc://getModuleFields","list":"rpc://getModuleFields","editSpam":"rpc://getModuleFields"
		};
	var res = [];

	for(var i=0; i<sortModules.length; i++) {
		var moduleObj = {};

		//Capitalize first Letter for Label
		moduleObj.label = iml.capitalize(sortModules[i]);

		//Values
		moduleObj.value = sortModules[i];

		//Add onChange depending on actionType
		if(iml.isPresent(modulesRPC[actionType]))
			moduleObj.nested = modulesRPC[actionType] + "?actionType=" + actionType;

		res.push(moduleObj)
	}

	return res;
}

