{
	//This function hides some fields to not be seen by user
	//Repairs some bugs found in request "Get Organization Fields" from Zoho Desk
	//module <string> : Name of the module, ex: "accounts","contacts","tickets"
	//fieldName <string> : Name of the field, ex: "accountId","productName","phone"
	//fieldType <string> : Type of the field returned by "Get Organization Fields" RPC

	var hiddenFields = {
		"tickets":["accountId"]
	}

	//Verify if field must appear to user
	if(iml.isPresent(hiddenFields[module])) {
		var hiddenFieldsModule = hiddenFields[module];
		if (hiddenFieldsModule.includes(fieldName))
			fieldType = "hidden";
	}
	return fieldType;
}

