getFieldType.code:
function getFieldType(type) {
  //This function makes the conversion between Zoho Desk data type and Integromat Data type
  //type <string> : Data type returned by Zoho Desk

  var fieldType;
  type = type.toLowerCase();

  switch (type) {
    case 'lookup':
    case 'long':
    case 'phone':
    case 'fax':
    case 'textarea':
      fieldType = 'text';
      break;
    case 'picklist':
      fieldType = 'select';
      break;
    case 'list':
    case 'multiselect':
      fieldType = 'array';
      break;
    case 'object':
      fieldType = 'collection';
      break;
    case 'date':
    case 'datetime':
      fieldType = 'date';
      break;
    case 'percent':
    case 'decimal':
    case 'currency':
      fieldType = 'number';
      break;
    default:
      fieldType = type;
  }

  return fieldType;
}

