getSearchValue.code:
function getSearchValue(searchBy,searchValue,customFields,customFieldsApi) 
{
	//This function returned the Search Value
	//searchBy <string> : Search after a specific field
	//searchValue <string> : Search value set in input by user
	//2 types of search: exact match, wildcard match (value passed partially)
	//wildcard match adds character "*" after the searchValue


	getCustomFieldIndex = () => {
		let index = 0;
		while(customFields[index] != searchBy){
			index++;
		}

		return index;
	}

	//Verify if is a custom field and returns the value
	if(iml.contains(customFields, searchBy))
		return customFieldsApi[getCustomFieldIndex()] + ":" + searchValue;

	var wildCardFields = [
			"accountName","title","categoryName","fullName", "firstName", "lastName","email", "phone","mobile",
			"tag", "productName","productCode","subject", "description", "category", "contactName"
	];

	//Makes a "Like" request
	if(iml.contains(wildCardFields,searchBy))
		searchValue+= "*";

	return searchValue;
}

