function processInputParameters(parameters, mappableParam, omit) {
  //This function sets the parameters in input
  //parameters <object> : Parameters set in request
  //omit <string> : Field that will be omited from input parameters

  if (!parameters) return null;

  // return new_parameters;
  return Object.entries(parameters)
    .filter(([key]) => !omit.includes(key))
    .reduce((newParameters, [key, value]) => {
      if (mappableParam.some(param => param.name === key && (param.metadata && param.metadata.onlyDate))) {
        value = iml.formatDate(value, 'YYYY-MM-DD');
      }
      if (key.startsWith("cf_")) {
        newParameters.cf = newParameters.cf || {};
        newParameters.cf[key] = value;
      } else {
        newParameters[key] = value;
      }
      return newParameters;
    }, {});
}

